import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';







class List extends Component {

  render() {
    return (
<div className="List">
  <ul>
    {this.props.items.map((item,id)=>
    (
      <li key={id}>{item.text}</li>
    ))}
    </ul>
</div>
    );
    }
  }



function App() {
  return (
    <div className="App">
    <h1> hello </h1>
    </div>
  );
}

export default App;
